import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import './styles/index.scss';
import HomePage from "./pages/HomePage";

function App() {
  return (
    <BrowserRouter>
      <Route path='/' Component={<HomePage />} />
    </BrowserRouter>
  );
}

export default App;
